 create database peoplesphones;
 
 create table Peoples (
    people_id SERIAL NOT NULL PRIMARY KEY,
    first_name VARCHAR(50) NOT NULL,
    last_name VARCHAR(50) NOT NULL,
    birthday DATE NOT NULL,
    gender VARCHAR(1) NOT NULL,
    height INTEGER NOT NULL,
    weight INTEGER NOT NULL
 );
  create table Phones (
    phone_id SERIAL NOT NULL PRIMARY KEY,
    phone_number VARCHAR(50)  NOT NULL,
    people_id INTEGER NOT NULL,
    assignment DATE NOT NULL,
    FOREIGN KEY (people_id) REFERENCES Peoples (people_id)
 );
 ALTER TABLE Phones ADD UNIQUE (phone_number);




